function Coin(props){
    const {coin}=props
    const price='$ '+(coin.current_price).toLocaleString('en-US')
    return(
        <tr>
            <td>{coin.name}</td>
            <td>{coin.symbol}</td>
            <td>{price}</td>
            <td>{'$ '+(coin.market_cap).toLocaleString('en-US')}</td>
            <td>{coin.total_volume}</td>
        </tr>
    )
}
export default Coin
